import React from "react";
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('WelcomeDiv'));

root.render(
    <React.StrictMode>
        <div id={"GameField"}>
            <img id={"samurai"} src={"Images/Samurai.png"}></img>
        </div>
    </React.StrictMode>
);
